FROM (SELECT full_join_data_sv."KEY" AS "KEY", sum(CAST(full_join_data_sv.dot_prod1 AS DOUBLE PRECISION)) + CAST(0.404074022364922 AS DOUBLE PRECISION) AS dot_product 
FROM (SELECT kernel_input_with_scaling."KEY" AS "KEY", "SV_data".dual_coeff * (kernel_input_with_scaling."Feature_0" * "SV_data".sv_0 + kernel_input_with_scaling."Feature_1" * "SV_data".sv_1 + kernel_input_with_scaling."Feature_2" * "SV_data".sv_2 + kernel_input_with_scaling."Feature_3" * "SV_data".sv_3 + kernel_input_with_scaling."Feature_4" * "SV_data".sv_4 + kernel_input_with_scaling."Feature_5" * "SV_data".sv_5 + kernel_input_with_scaling."Feature_6" * "SV_data".sv_6 + kernel_input_with_scaling."Feature_7" * "SV_data".sv_7 + kernel_input_with_scaling."Feature_8" * "SV_data".sv_8 + kernel_input_with_scaling."Feature_9" * "SV_data".sv_9 + kernel_input_with_scaling."Feature_10" * "SV_data".sv_10 + kernel_input_with_scaling."Feature_11" * "SV_data".sv_11 + kernel_input_with_scaling."Feature_12" * "SV_data".sv_12 + kernel_input_with_scaling."Feature_13" * "SV_data".sv_13 + kernel_input_with_scaling."Feature_14" * "SV_data".sv_14 + kernel_input_with_scaling."Feature_15" * "SV_data".sv_15 + kernel_input_with_scaling."Feature_16" * "SV_data".sv_16 + kernel_input_with_scaling."Feature_17" * "SV_data".sv_17 + kernel_input_with_scaling."Feature_18" * "SV_data".sv_18 + kernel_input_with_scaling."Feature_19" * "SV_data".sv_19 + kernel_input_with_scaling."Feature_20" * "SV_data".sv_20 + kernel_input_with_scaling."Feature_21" * "SV_data".sv_21 + kernel_input_with_scaling."Feature_22" * "SV_data".sv_22 + kernel_input_with_scaling."Feature_23" * "SV_data".sv_23 + kernel_input_with_scaling."Feature_24" * "SV_data".sv_24 + kernel_input_with_scaling."Feature_25" * "SV_data".sv_25 + kernel_input_with_scaling."Feature_26" * "SV_data".sv_26 + kernel_input_with_scaling."Feature_27" * "SV_data".sv_27 + kernel_input_with_scaling."Feature_28" * "SV_data".sv_28 + kernel_input_with_scaling."Feature_29" * "SV_data".sv_29) AS dot_prod1 
FROM kernel_input_with_scaling, "SV_data") AS full_join_data_sv GROUP BY full_join_data_sv."KEY") AS t)
 SELECT kernel_dp."KEY" AS "KEY", -kernel_dp.dot_product AS "Score_0", kernel_dp.dot_product AS "Score_1", CAST(NULL AS DOUBLE PRECISION) AS "Proba_0", CAST(NULL AS DOUBLE PRECISION) AS "Proba_1", CAST(NULL AS DOUBLE PRECISION) AS "LogProba_0", CAST(NULL AS DOUBLE PRECISION) AS "LogProba_1", CASE WHEN (kernel_dp.dot_product > CAST(0.0 AS DOUBLE PRECISION)) THEN 1 ELSE 0 END AS "Decision", CAST(NULL AS DOUBLE PRECISION) AS "DecisionProba" 
FROM kernel_dp